import { useState } from 'react';
import {axios}  from 'axios';


function Register() {

    const [nombre, setNombre] = useState('');
    const [correo, setCorreo] = useState('');
    const [pssw, setPssw] = useState('');

    const enviarDatos = () =>{
        axios.post("http://localhost:3300/registro",{

            name: nombre,
            email: correo,
            pssw: pssw

        }
        )
    }

    return (  
        <>
        <h1>Registro de cuenta</h1>

            <div class="mb-3">
                <label class="form-label">Nombre</label>
                <input onChange={(e)=>setNombre(e.target.value)} type="text" class="form-control"/>          
            </div>

            <div class="mb-3">
                <label class="form-label">Correo</label>
                <input onChange={(e)=>setCorreo(e.target.value)} type="email" class="form-control"/>          
            </div>

            <div class="mb-3">
                <label class="form-label">Contrase√±a</label>
                <input onChange={(e)=>setPssw(e.target.value)} type="password" class="form-control"/>          
            </div>

            <button type='button' class="button-primary">Registrarse</button>
   
        </>
    );
}

export default Register;
